import React, {Component} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import FormHelperText from '@material-ui/core/FormHelperText';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import TextField from '@material-ui/core/TextField';
import Select from '@material-ui/core/Select';
import Button from '@material-ui/core/Button';
import Divider from '@material-ui/core/Divider';

const useStyles = makeStyles(theme => ({
	root: {
		display: 'flex',
		flexWrap: 'wrap',
		alignItems: 'center',
	},

	formControl: {
		margin: theme.spacing(1),
		minWidth: 120,
	},

	header:{
		margin: 0,
	},

	button:{
		margin: theme.spacing(1),
	},

	selectEmpty: {
		marginTop: theme.spacing(2),
	},
}));

export default function ContractCreator() {
	const classes = useStyles();
	const [values, setValues] = React.useState({
		auctionType: '',
		reservePrice: '',
		name:''
	});

	function handleChange(event) {
		setValues(oldValues => ({
		...oldValues,
		[event.target.name]: event.target.value,
		}));
	}

	return (
		<React.Fragment>
			<h2 className={classes.header}>English</h2>
			<form className={classes.root} autoComplete="off">
				<FormControl className={classes.formControl}>
					<TextField 
						id="en-reserve-price" 
						label="Reserve Price"
						className={classes.textField}
						margin="none"
					/>
					<FormHelperText>(wei)</FormHelperText>
				</FormControl>
				<FormControl className={classes.formControl}>
					<TextField 
						id="en-buyout-price" 
						label="Buy Out"
						className={classes.textField}
						margin="none"
					/>
					<FormHelperText>(wei)</FormHelperText>
				</FormControl>
				<FormControl className={classes.formControl}>
					<TextField 
						id="en-increment" 
						label="Min. Increment"
						className={classes.textField}
						margin="none"
					/>
					<FormHelperText>(wei)</FormHelperText>
				</FormControl>
				<FormControl className={classes.formControl}>
					<TextField 
						id="en-unchallenged-length" 
						label="Unchallenged Length"
						className={classes.textField}
						margin="none"
					/>
					<FormHelperText>(blocks)</FormHelperText>
				</FormControl>
			</form>
			<Button variant="contained" className={classes.button}>Deploy!</Button>

			<Divider variant="middle" />

			<h2 className={classes.header}>Vickery</h2>
			<form className={classes.root} autoComplete="off">
				<FormControl className={classes.formControl}>
					<TextField 
						id="vk-reserve-price" 
						label="Reserve Price"
						className={classes.textField}
						margin="none"
					/>
					<FormHelperText>(wei)</FormHelperText>
				</FormControl>
				<FormControl className={classes.formControl}>
					<TextField 
						id="vk-min-deposit" 
						label="Min. Deposit"
						className={classes.textField}
						margin="none"
					/>
					<FormHelperText>(wei)</FormHelperText>
				</FormControl>
			</form>
			<form className={classes.root} autoComplete="off">
				<FormControl className={classes.formControl}>
					<TextField 
						id="vk-commitment-length" 
						label="Commitment Phase Length"
						className={classes.textField}
						margin="none"
					/>
					<FormHelperText>(blocks)</FormHelperText>
				</FormControl>
				<FormControl className={classes.formControl}>
					<TextField 
						id="vk-withdrawal-length" 
						label="Withdrawal Phase Length"
						className={classes.textField}
						margin="none"
					/>
					<FormHelperText>(blocks)</FormHelperText>
				</FormControl>
				<FormControl className={classes.formControl}>
					<TextField 
						id="vk-opening-length" 
						label="Opening Phase Length"
						className={classes.textField}
						margin="none"
					/>
					<FormHelperText>(blocks)</FormHelperText>
				</FormControl>
			</form>
			<Button variant="contained" className={classes.button}>Deploy!</Button>
		</React.Fragment>
	);
}

